import React from "react";
import Inputitem from "../../Molecules/Inputitem/Inputitem";
import List from "../../Organisms/List/List"

const Main = () =>{
    const list = [
        {text: "teste"},
        {text: "teste1"},
        {text: "teste2"},
    ]
    return(
        <div id="Main">
            <Inputitem itemList={list}/>
            <List/>
        </div>
    )
}

export default Main
